T.s("progress-helper-text",'Tuples<Status, String> status = tuples(\n        info, "Default variant",\n        success, "Success variant",\n        warning, "Warning variant",\n        danger, "Danger variant"\n);\nProgress progress = progress();\nHelperText helperText = helperText("Default variant is being displayed");\n\nreturn div()\n        .run(div -> {\n            for (Tuple<Status, String> tuple : status) {\n                div.add(radio(Id.build("progress-helper-text", tuple.key.name()),\n                        "progress-helper-text-status",\n                        tuple.value)\n                        .value(tuple.key == info)\n                        .onChange((event, component, value) -> {\n                            progress.status(tuple.key);\n                            helperText.firstItem().text(tuple.value + " is being displayed");\n                        }));\n            }\n        })\n        .add(br())\n        .add(progress\n                .title("Title")\n                .value(33)\n                .addHelperText(helperText))\n        .element();');
T.s("form-select-basic",'String[] values = {"Mr", "Miss", "Mrs", "Ms", "Dr", "Other"};\nreturn div()\n        // if not specified, Id.build(<label>) is used as value\n        .add(formSelect("basic-form-select-0", Id.build("Mrs"))\n                .addOption(formSelectOption("Select one").placeholder())\n                .addOptions(asList(values), FormSelectOption::formSelectOption))\n        .element();');T.s("form-select-validated",'final double[] handle = {0};\nHelperText helperText = helperText("");\nFormSelect formSelect = formSelect("validated-form-select-0")\n        .onChange((e, fs, value) -> {\n            clearTimeout(handle[0]);\n            fs.validated(default_);\n            helperText.firstItem()\n                    .status(default_)\n                    .text("Validating...");\n            int number = Integer.parseInt(value);\n            handle[0] = setTimeout(__ -> {\n                if (number == 0) {\n                    fs.validated(warning);\n                    helperText.firstItem()\n                            .status(warning)\n                            .text("You must have select a value");\n                } else if (number == 3) {\n                    fs.validated(success);\n                    helperText.firstItem()\n                            .status(success)\n                            .text("You chose wisely");\n                } else {\n                    fs.validated(error);\n                    helperText.firstItem()\n                            .status(error)\n                            .text("You must chose Three (thought that was obvious)");\n                }\n            }, 1234);\n        });\nreturn div()\n        .add(form()\n                .add(formGroup()\n                        .addLabel(formGroupLabel("Comments:"))\n                        .addControl(formGroupControl()\n                                .addControl(formSelect\n                                        .addOption(formSelectOption("Select a number", "0")\n                                                .placeholder(true))\n                                        .addOption(formSelectOption("One", "1"))\n                                        .addOption(formSelectOption("Two", "2"))\n                                        .addOption(formSelectOption("Three - the only valid option", "3")))\n                                .addHelperText(helperText))))\n        .element();');
